    function MineStatus(address user)public view override returns(uint256){
        uint256 difference = block.number.sub(_mineInfo[user][1]);
        uint256 start = blockStatus(_mineInfo[user][1]);
        uint256 end = blockStatus(block.number);
        uint256 mined_area = start.add(end).mul(difference).div(2);
        //All TOKENs that are connected and mined in these two regions
        
        uint dcf_amount = mined_area.mul(_mineInfo[user][2]).div(_totalPower);
        return _mineInfo[user][3].add(dcf_amount);       
    }
   

