        if(_BlockNumber < _startBlockNumber){
            _BlockNumber = _startBlockNumber;
        }
        uint256 DCFperBlock = _DCFperBlock.mul(1e18);           
        uint256 b = _BlockNumber.mul(1e18).div(_startBlockNumber);
        uint256 c = DCFperBlock.div(b);
        return c;    
    }

   


